pragma solidity ^0.5.10;

import "../interfaces/IRegistry.sol";

import "./Multisig.sol";

contract OrgMultisig is Multisig {

    /////
    // Constants:
    /////

    // Claim values. All tx participants must have a claim in the registry from CLAIM_ADDR with:
    //  - key == CLAIM_KEY
    //  - value == CLAIM_VAL
    address public constant CLAIM_ADDR = address(0);
    bytes32 public constant CLAIM_KEY = keccak256("KYC");
    bytes32 public constant CLAIM_VAL = bytes32(uint(1));

    /////
    // Storage:
    /////

    // Registry contract to check claims
    IRegistry public registry;

    /////
    // Constructor:
    /////

    /**
    * @dev Constructor. ** Not run except for the base deployment! **
    * @param _guard Address of a guard implementation
    */
    // solhint-disable-next-line no-empty-blocks
    constructor(address _guard) public Multisig(_guard) {}

    /////
    // Initialization function:
    /////

    function setup(
        uint256 _threshold,
        uint256 _chainId,
        address[] memory _signers,
        address payable _grave,
        address _guard,
        address _registry
    )
        public
    {
        require(registry == IRegistry(address(0)), "registry-set");
        registry = IRegistry(_registry);

        Multisig.setup(_threshold, _chainId, _signers, _grave, _guard);
    }

    /////
    // Public view functions:
    /////

    function isValidSigner(address _signer) 
        public 
        view 
        returns (bool)
    {
        bytes32 claimVal = registry.getClaim(
            CLAIM_ADDR,
            msg.sender,
            CLAIM_KEY
        );
        bool validClaim = claimVal == CLAIM_VAL;
        bool validSigner = signers[_signer] != address(0);
        return validSigner && validClaim;
    }
}
